function tcn(){
  console.log('tcn!')
  var list = document.getElementsByClassName('btn btn-default');
  for(var i=0;i<list.length;i++){
    var ele = list[i];
    var slotid = ele.getAttribute('data-slotitemid');
    if(cnarr[slotid]){
      ele.innerHTML=cnarr[slotid];
    }
  }
  var l2 = document.getElementsByClassName('dropdown-menu');
  for(var i=0;i<l2.length;i++){
    var ele = l2[i];
    var l2c = ele.children;
    for(var j=0;j<l2c.length;j++){
      var elc = l2c[j];
      if(elc.children){
        if(elc.children[0]){
          if(elc.children[0].children){
            var itemid = elc.children[0].getAttribute('data-itemid');
            if(cnarr[itemid]){
              elc.children[0].children[0].innerHTML=cnarr[itemid];
            }
          }
        }
      }
    }
  }
}



